package app.model.update;

import java.util.List;

/**
* @author Donghao
* @version date：2021年9月22日 下午3:30:43
* 
*/
public class MessageJniConfiguration {
	String ctxt ;
	String app ;
	String proc ;
	
	List<String> keyList;
	
	public MessageJniConfiguration() {
		// TODO Auto-generated constructor stub
	}
	
	

	public MessageJniConfiguration(String ctxt, String app, String proc, List<String> keyList) {
		super();
		this.ctxt = ctxt;
		this.app = app;
		this.proc = proc;
		this.keyList = keyList;
	}



	public String getCtxt() {
		return ctxt;
	}

	public void setCtxt(String ctxt) {
		this.ctxt = ctxt;
	}

	public String getApp() {
		return app;
	}

	public void setApp(String app) {
		this.app = app;
	}

	public String getProc() {
		return proc;
	}

	public void setProc(String proc) {
		this.proc = proc;
	}

	public List<String> getKeyList() {
		return keyList;
	}

	public void setKeyList(List<String> keyList) {
		this.keyList = keyList;
	}

	
	
	
}
